import { useContext } from "react";
import axios from'axios'
import UserContext from "../../UserContext";
import { useNavigate } from "react-router-dom";

export default function CadastrarDadosUser(){

    const { cadastroUser, setCadastroUser } = useContext(UserContext);

    const navigate = useNavigate()

    const POST_URL = 'localhost:5000/cadastrar'
    const promiseCadastrar = axios(POST_URL, cadastroUser)

    promiseCadastrar.then(()=>navigate('/'))
    promiseCadastrar.catch(()=>alert(`Erro ao cadastrar o usário.`))
}
